INSERT INTO `onlineexamquestion` (`oeExamId`, `oeQuestionId`, `oeQuestion`, `oeQuestionType`, `oeCorrectAnswer`, `oeMarkPerAnswer`, `oeExplanation`, `createdBy`, `createdDate`, `modifiedBy`, `modifiedDate`, `status`, `uploadFileLastModifiedDate`, `uploadFileDate`, `uploadFileSize`, `uploadFileName`, `uploadFileFolderURL`, `uploadExplanationFileLastModifiedDate`, `uploadExplanationFileDate`, `uploadExplanationFileSize`, `uploadExplanationFileName`, `uploadExplanationFileFolderURL`) VALUES ('EXM140702032028430', 'QSN140702032329573', 'Which one of these lists contains only Java programming language keywords?', 'MCQ', '2', '1', 'All the words in option B are among the 49 Java keywords. Although goto reserved as a keyword in Java, goto is not used and has no function.\r\n\r\nOption A is wrong because the keyword for the primitive int starts with a lowercase i.\r\n\r\nOption C is wrong because "virtual" is a keyword in C++, but not Java.\r\n\r\nOption D is wrong because "constant" is not a keyword. Constants in Java are marked static and final.', 'SuperAdmin', '2014-07-02 15:23:29', NULL, NULL, '', NULL, NULL, 0, NULL, NULL, NULL, NULL, 0, NULL, NULL), ('EXM140702032028430', 'QSN140702032409484', 'Which will legally declare, construct, and initialize an array?', 'MCQ', '4', '1', 'The only legal array declaration and assignment statement is Option D\r\n\r\nOption A is wrong because it initializes an int array with String literals.\r\n\r\nOption B is wrong because it use something other than curly braces for the initialization.\r\n\r\nOption C is wrong because it provides initial values for only one dimension, although the declared array is a two-dimensional array.', 'SuperAdmin', '2014-07-02 15:24:09', NULL, NULL, '', NULL, NULL, 0, NULL, NULL, NULL, NULL, 0, NULL, NULL), ('EXM140702032028430', 'QSN140702032506324', 'Which is a reserved word in the Java programming language?', 'MCQ', '2', '1', 'The word "native" is a valid keyword, used to modify a method declaration.\r\n\r\nOption A, D and E are not keywords. Option C is wrong because the keyword for subclassing in Java is extends, not \'subclasses\'.', 'SuperAdmin', '2014-07-02 15:25:06', NULL, NULL, '', NULL, NULL, 0, NULL, NULL, NULL, NULL, 0, NULL, NULL), ('EXM140702032028430', 'QSN140702032553849', 'Which is a valid keyword in java?', 'MCQ', '1', '1', 'interface is a valid keyword.\r\n\r\nOption B is wrong because although "String" is a class type in Java, "string" is not a keyword.\r\n\r\nOption C is wrong because "Float" is a class type. The keyword for the Java primitive is float.\r\n\r\nOption D is wrong because "unsigned" is a keyword in C/C++ but not in Java.', 'SuperAdmin', '2014-07-02 15:25:53', NULL, NULL, '', NULL, NULL, 0, NULL, NULL, NULL, NULL, 0, NULL, NULL), ('EXM140702032028430', 'QSN140702033019422', 'Which is the valid declarations within an interface definition?', 'MCQ', '1', '1', 'Option A is correct. A public access modifier is acceptable. The method prototypes in an interface are all abstract by virtue of their declaration, and should not be declared abstract.', 'SuperAdmin', '2014-07-02 15:30:19', NULL, NULL, '', NULL, NULL, 0, NULL, NULL, NULL, NULL, 0, NULL, NULL), ('EXM140702032028430', 'QSN140702033129434', 'Which one is a valid declaration of a boolean?', 'MCQ', '3', '1', 'A boolean can only be assigned the literal true or false.', 'SuperAdmin', '2014-07-02 15:31:29', NULL, NULL, '', NULL, NULL, 0, NULL, NULL, NULL, NULL, 0, NULL, NULL), ('EXM140702032028430', 'QSN140702033226437', 'Which is a valid declarations of a String?', 'MCQ', '1', '1', 'Option A sets the String reference to null.', 'SuperAdmin', '2014-07-02 15:32:26', NULL, NULL, '', NULL, NULL, 0, NULL, NULL, NULL, NULL, 0, NULL, NULL), ('EXM140702032028430', 'QSN140702033428697', 'What is the numerical range of a char?', 'MCQ', '4', '1', 'A char is really a 16-bit integer behind the scenes, so it supports 216 (from 0 to 65535) values.', 'SuperAdmin', '2014-07-02 15:34:28', NULL, NULL, '', NULL, NULL, 0, NULL, NULL, NULL, NULL, 0, NULL, NULL), ('EXM140702032028430', 'QSN140702033532430', 'Which one of the following will declare an array and initialize it with five numbers?', 'MCQ', '2', '1', 'Option B is the legal way to declare and initialize an array with five elements.', 'SuperAdmin', '2014-07-02 15:35:32', NULL, NULL, '', NULL, NULL, 0, NULL, NULL, NULL, NULL, 0, NULL, NULL), ('EXM140702032028430', 'QSN140702033726286', 'Which three are valid declarations of a char?\r\n\r\n1.char c1 = 064770;\r\n2.char c2 = \'face\';\r\n3.char c3 = 0xbeef;\r\n4.char c4 = \\u0022;\r\n5.char c5 = \'\\iface\';\r\n6.char c6 = \'\\uface\';', 'MCQ', '2', '1', '(1), (3), and (6) are correct. char c1 = 064770; is an octal representation of the integer value 27128, which is legal because it fits into an unsigned 16-bit integer. char c3 = 0xbeef; is a hexadecimal representation of the integer value 48879, which fits into an unsigned 16-bit integer. char c6 = \'\\uface\'; is a Unicode representation of a character.', 'SuperAdmin', '2014-07-02 15:37:26', NULL, NULL, '', NULL, NULL, 0, NULL, NULL, NULL, NULL, 0, NULL, NULL), ('EXM140702110811955', 'QSN140702110831981', 'maths-ques.pdf', 'TestSeries', NULL, NULL, NULL, 'SuperAdmin', '2014-07-02 11:08:31', NULL, NULL, '', NULL, NULL, 0, NULL, NULL, NULL, NULL, 0, NULL, NULL), ('EXM140705014016001', 'QSN140705014045403', 'plus-two-physics-one-mark-pdf-pem-1m-with-ans-boxed.pdf', 'TestSeries', NULL, NULL, NULL, 'SuperAdmin', '2014-07-05 13:40:45', NULL, NULL, '', NULL, NULL, 0, NULL, NULL, NULL, NULL, 0, NULL, NULL), ('EXM140702032028430', 'QSN140709033850628', '', 'MCQ', '1', '1', '', 'SuperAdmin', '2014-07-09 15:38:50', NULL, NULL, '', '2014-07-09 15:38:51', '2014-07-09 15:38:50', 7531, 'q1.PNG', '/DocBase/EduTel/Shared/2014/ExamQuestion/Computer-Basic/QSN140709033850628', '2014-07-09 15:38:51', '2014-07-09 15:38:50', 9787, 'e3.PNG', '/DocBase/EduTel/Shared/2014/ExamQuestion/Computer-Basic/QSN140709033850628'), ('EX