INSERT INTO `querydiscussion` (`qtAutoId`, `qtQuery`, `qtAnswer`, `qtRated`, `qtRaisedBy`, `qtRaisedName`, `qtRaisedDate`, `qtReplyBy`, `qtReplyName`, `qtReplyDate`) VALUES (1, 'test1', 'afsdfsadf', 5, 'Ananth', 'Ananth', '2014-07-22 12:23:57', 'SuperAdmin', 'SuperAdmin', '2014-07-24 13:05:46'), (2, 'test2', 'answer2', 4, 'Ananth', 'Ananth', '2014-07-22 12:21:52', 'SuperAdmin', 'SuperAdmin', '2014-07-24 13:05:40'), (3, 'test3', 'adsfasdf', 3, 'Ananth', 'Ananth', '2014-07-22 12:16:15', 'SuperAdmin', 'SuperAdmin', '2014-08-16 11:01:20'), (4, 'test4', ' Hello Haripriya K, The Best options for medical institute are AIPMT,AIIMS,CMC,SRM,JIPMER,St.Johns- Bangalore for which you have to write the respective entrance exams conducted by the colleges and get selected through merit.Apart from this you have many colleges for MBBS in tamilnadu for which you can enter through the tamilnadu counselling.Tamil Nadu is a state with good number of Medical College and most of the medical colleges in the state are affiliated to the Tamil Nadu Dr. MGR Medical University located in the capital city of Chennai. The importance given to medical education in the state of Tamil Nadu can be understood by the establishment of a separate university for medical education in the state by the state government in the year 1987 itself, which is one of the few universities meant for medical education in the nation.About MBBS colleges in Tamil Nadu:There are about 40 medical colleges for MBBS course in Tamil Nadu and all these colleges are functioning with approval from the medical council of India. Out of these 40 MBBS colleges around 18 colleges are functioning under the control of Government of India and other colleges are functioning under private ownership.List of MBBS Colleges in Tamil Nadu:ACS Medical College, ChennaiAnnapoorna Medical CollegeHaripriya K2014-08-20 19:19:59.0National Model Mat.Hr.Sec.ShoolExpert2014-08-21 13:31:55.0TO do MBBS a private college is better or government collegeHi BAKYARACHNAA, Some points should be taken into account before the selection of any college to pursue a course that for how many years the college has been in existence, lab facilities, student exchange programs and so on. Holistic recognition of institutions from every aspect must be the criteria for the selection of any institution for the pursuance of these courses.But first choice should be the elite institutions of the country i.e. AIIMS, CMC-Vellore, JIPMER, MGIMS-Wardha, Manipal-MAHE, COMED-K, AMU,and AFMC and so on. These colleges have a history of excellent pedagogy, infrastructure and placements. However, qualifying these tests is really a herculean task; one has to work hard to get into these institutions.Also, if you consider Tuition Fees has a factor then Govt. colleges are far better than private ones. Apart from that a good number of candidates scholarships in Govt. colleges so an overall picture suggests a Govt. college prior to a private college. Rest depends on your hard work. For now you just prepare well for entrance exams. Try to give your best and wait for the options you get.Bakyarachnaa RnullDav Mat.Hr.Sec.School Mogappair EastSuperadmin2014-08-14 15:21:59.0what is the best college for medicine in Tamlnadu?Hi K.P.NIVETHA, Tamil Nadu is a state with good number of Medical College and most of the medical colleges in the state are affiliated to the Tamil Nadu Dr. MGR Medical University located in the capital city of Chennai. The importance given to medical education in the state of Tamil Nadu can be understood by the establishment of a separate university for medical education in the state by the state government in the year 1987 itself, which is one of the few universities meant for medical education in the nation. About MBBS colleges in Tamil Nadu: There are about 40 medical colleges for MBBS course in Tamil Nadu and all these colleges are functioning with approval from the medical council of India. Out of these 40 MBBS colleges around 18 colleges 